  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0073808 includes chemical,
  meteorological, physical, time series and underway - surface data collected from
  GULF CHALLENGER in the North Atlantic Ocean and Stellwagen Bank National Marine
  Sanctuary from 2004-05-10 to 2013-08-15 and retrieved during cruise 33GC20040510.
  These data include AIR TEMPERATURE, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, Partial
  pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE TEMPERATURE and
  WATER TEMPERATURE. The instruments used to collect these data include Carbon dioxide
  (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
  (CO2) measurement. These data were collected by Dr. Joseph Salisbury and Douglas
  Vandemark of University of New Hampshire as part of the Gulf_of_Maine_Coastal_Cruises
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
